<script>
  document.addEventListener("DOMContentLoaded", function () {
    const form = document.querySelector('form');
    const loadingDiv = document.getElementById('loading');

    if (form && loadingDiv) {
      form.addEventListener('submit', function (e) {
        e.preventDefault(); // voorkom directe submit
        loadingDiv.style.display = 'block';

        // Wacht 5 sec, verberg de loader en submit het formulier
        setTimeout(function () {
          loadingDiv.style.display = 'none';
          form.submit(); // hier wordt het echt verzonden
        }, 9000);
      });
    } else {
      console.error("Formulier of loading-div niet gevonden");
    }
  });
</script>
